waves.point_eqs_eel:
n=sample*6.283;
phs=-sample * 0.2;
tm=q1 + phs;

flip=flip+1;
flip=flip*below(flip,2);

xp=0;
yp=(flip*0.1-0.05)*(1-sample);
zp=0;

//spin;
ang=tm*50;
sa=sin(ang);ca=cos(ang);
xr=xp*sa + yp*ca;
yr=xp*ca - yp*sa;
zr=zp;

xp=xr;
yp=yr + 0.05 + (sin(tm)*0.5 + 0.5)*0.2 + 0.05;
zp=zr;

//wrist movement;
ang=sin(tm*2)*0.5 +0.5;

xq=xp;
sa=sin(ang);ca=cos(ang);
yq=yp*sa + zp*ca;
zq=yp*ca - zp*sa;
yq=yp;
zq=zp;

ang=tm*8;
sa=sin(ang);ca=cos(ang);
xp=xq*sa + yq*ca;
yp=xq*ca - yq*sa;
zp=zq;

//forearm movement;
zp=zp-0.3;
ang=3.14 + sin(tm*2 - 0.5)*1.5;
xq=xp;
sa=sin(ang);ca=cos(ang);
yq=yp*sa + zp*ca;
zq=yp*ca - zp*sa;

//upper arm twist
ang=-1.0 + cos(tm*3 + 0.5);
xp=xq*sa + yq*ca;
yp=xq*ca - yq*sa;
zp=zq;

//upper arm outward;
zp=zp-0.35;
ang=cos(tm*2)*0.75 - 1.05;
sa=sin(ang);ca=cos(ang);
xq=xp*sa + zp*ca;
yq=yp;
zq=xp*ca - zp*sa;

//upper arm up down;
ang=cos(tm)*0.5 - 0.5;
xp=xq;
sa=sin(ang);ca=cos(ang);
yp=yq*ca - zq*sa;
zp=yq*sa + zq*ca;

//xp=xq;yp=yq;zp=zq;


//project into screenspace and draw on screen
zp=zp+2;
xs=xp/zp;
ys=yp/zp;

x=xs+0.5;
y=ys*1.3+0.5;


